INSERT INTO `systemRankings` (`rankingID`, `label`, `name`, `numberOfInstances`, `description`, `Pool_Bracket`, `Pool_Sets`, `Scored_Event`, `displayFunction`, `scoringFunction`, `rankingFunction`, `advancementFunction`) VALUES
(1, 'franklin2014', 'Franklin 2014', 66, 'Calculation:\r\n +[Points For]\r\n +(5 * [Wins])\r\n -[Points Against]\r\n -(Doubles Penalty)\r\n\r\nDoubles Penalty\r\n1 Double -> 1 = 1\r\n2 Doubles -> 1+2 = 3\r\n3 Doubles -> 1+2+3 = 6 etc...\r\n\r\nRanking:\r\n1) Pool winners first\r\n2) Score\r\n3) Wins\r\n4) Doubles\r\n\r\n\r\n', 1, 0, 0, 'BasicStats', 'Franklin2014', 'PoolScoreWins', NULL),
(2, 'RSScutting', 'RSS Cutting', 6, 'Root Sum Square Cutting\n\nScoring\nTotal Deduction = sqrt([Cut Deduction]^2 + [Form Deduction]^2)\nScore = 20 - Cut Deduction\n\nRanking\n1) By Score\n2) Least deductions', 0, 0, 1, 'RSScutting', 'RSScutting', NULL, NULL),
(3, 'resultsOnly', 'Results Only', 12, NULL, 0, 0, 0, NULL, NULL, NULL, NULL),
(4, 'deductionBased', 'Deduction Based', 1, 'Scoring\r\n100 point base score\r\nDeductions from the base score', 0, 0, 1, 'DeductionBased', 'DeductionBased', NULL, NULL),
(5, 'fny2017', 'FNY 2017', 3, 'Fechtshule New York 2017\r\n\r\nScoring:\r\nOne exchange matches\r\n+ 1*Wins\r\n- 2*[Losses]\r\n- 2*[Doubles]\r\n\r\nRanking:\r\nCumulative across multiple pools', 0, 1, 0, 'FNY2017', 'FNY2017', 'ByScore', 'FNY2017'),
(6, 'seedPool', 'Seeded Pool', 1, 'First pool of top fighters. Fighters in the first pool are ranked ahead of all other fighters, regardless of score.\r\n\r\nScoring uses Franklin 2014.\r\n\r\nUse when there are a few fighters with a significant skill gap above other competitors.', 1, 0, 0, 'BasicStats', 'Franklin2014', 'SeededPool', NULL),
(7, 'totalPts', 'Total Points Scored', 1, 'Scoring\r\n +[Points For]\r\n\r\nRanking\r\n1) Wins\r\n2) Score\r\n3) Doubles', 1, 0, 0, 'BasicStats', 'PointsFor', 'WinsScore', NULL),
(8, 'hitRatio', 'Hit Ratio', 0, 'Score\r\n[Points For] / [Total Times Hit]\r\n\r\nRanking\r\n1) Score\r\n2) Wins', 1, 0, 0, 'ScoreHitRatio', 'ScoreHitRatio', 'ByScore', NULL),
(9, 'sandstorm2017', 'Sandstorm 2017', 2, 'Scoring:\r\n3 Points - Controlled Win/Artful Exchange\r\n2 Points - Win\r\n1 Point - Win w/ Afterblow\r\n\r\nRanking:\r\nBy Score\r\n', 1, 0, 0, 'Sandstorm', 'Sandstorm', 'ByScore', NULL),
(10, '2point', '2 Point Cumulative', 2, 'Used for Singlestick in Helsinki Open 2018\r\n\r\nScoring:\r\n2 Points for Win\r\n1 Point for Tie\r\n\r\nRanking:\r\nBy Score', 0, 1, 0, '2point', '2point', 'ByScore', 'FNY2017');
